// SPDX-License-Identifier: MIT
pragma experimental ABIEncoderV2;
pragma solidity >=0.5.8;

contract checkActeur {
    address admin = 0x7807C109B324Ab7a3BbE36040b19e5007f3cb1aB;

    mapping(address => bool) private isAuthorized;
    mapping(address => string) private passwords;
    mapping(address => string) private emails;
    constructor() public {
        // Donner l'autorisation à l'adresse admin
        isAuthorized[admin] = true;
        passwords[admin] = "8c6976e5b5410415bde908bd4dee15dfb167a9c873fc4bb8a81f6f2ab448a918";
        //compte[admin]=Compte("admin","8c6976e5b5410415bde908bd4dee15dfb167a9c873fc4bb8a81f6f2ab448a918");
        emails[admin] = "admin@example.com";
    }

    struct Institute
    {
        address adresseEthereum;
        string name;
        string email;
        string WebSite;
        string[] departements;
        string acronym;
        bool autorisation;
    }

    struct Compte
    {
        bytes32 pass;
        string role;
    }
    struct Student
    {
        string institutename;
        string name;
        string email;
        string dateOfBirth;
        string mention;
        string dateRemiseDiplome;
        string numCIN;
        string department;
        string ipfsHash;
        string id;
    }
    Institute[] public institute;

    uint256 public instituteCount = 0;
    mapping(address=>Compte) public compte;
    // Mapping pour associer à chaque adresse d'institut la liste de ses étudiants
    mapping(address => Student[]) private instituteToStudents;
    mapping(string => Student) studentsById;
    mapping(string => Student) studentByCin;

    function checkAuthorization(string memory email,string memory passwordHash) public view returns (bool) {
        // Vérifier si l'adresse est autorisée
        if (!isAuthorized[msg.sender]) {
            return false;
        }

        string storage storedPasswordHash = passwords[msg.sender];
        bool passwordMatches = keccak256(bytes(passwordHash)) == keccak256(bytes(storedPasswordHash));
          if (!passwordMatches) {
        return false;
    }
        string storage storedEmail = emails[msg.sender];
        bool emailMatches = keccak256(bytes(email)) == keccak256(bytes(storedEmail));
        if (!emailMatches) {
        return false;
    }

        // Si l'adresse et le mot de passe sont corrects, donner l'autorisation
        return true;
    }

    event InstituteAlreadyExists(address indexed _adresseEthereum);
    function addInstitute(address _adresseEthereum, string memory _name, string memory _email, string memory _WebSite, string[] memory _departements,
                           string memory _acronym) public 
    {
        //verifier est ce que l'adresse ethereum est deja existe, si oui on ne peut pas ajouter l'institue
        bool exists = false;
        for (uint i = 0; i < institute.length; i++) {
            if (institute[i].adresseEthereum == _adresseEthereum) {
                exists = true;
                emit InstituteAlreadyExists(_adresseEthereum); // émettre l'événement pour indiquer l'adresse Ethereum existante

                break;
            }
        }

        require(!exists, " institue deja existant");

        //l'ajout de l'institue 
        institute.push(Institute(_adresseEthereum, _name,_email, _WebSite, _departements,_acronym, true));
        instituteCount++;


        //le role et le mot de passe 
        bytes32 hashedPassword = sha256(abi.encodePacked("institute"));
        compte[_adresseEthereum] = Compte(hashedPassword, "institute");
    }

    function getInstitute(uint index) public view returns (address, string memory, string memory, string memory, string[] memory, string memory, bool) {
        require(index >= 0 && index < institute.length, "Index en dehors de la plage valide");

        Institute memory inst = institute[index];
        return (inst.adresseEthereum, inst.name, inst.email, inst.WebSite, inst.departements, inst.acronym, inst.autorisation);
    }
   function getInstituteCount() public view returns (uint256) {
        return institute.length;
    }

    function getMyInstitute() public view returns (address, string memory, string memory, string memory, string[] memory, string memory, bool) {
    address myAddress = msg.sender;
    for (uint i = 0; i < institute.length; i++) {
        if (institute[i].adresseEthereum == myAddress) {
            Institute memory inst = institute[i];
            return (inst.adresseEthereum, inst.name, inst.email, inst.WebSite, inst.departements, inst.acronym, inst.autorisation);
        }
    }
    revert("Institut non trouve");
    }



    function findInstitute(address _adresseEthereum) public view returns(int256)
    {
        for(uint i=0; i<instituteCount; i++)
        {
            if(_adresseEthereum == institute [i].adresseEthereum)
                return int256(i);
        }
        return -1;
    }
    function getInstituteAddressByEmail(string memory _email) public view returns (address) {
    for (uint i = 0; i < institute.length; i++) {
        //le email est hashé
        if (keccak256(bytes(institute[i].email)) == keccak256(bytes(_email))) {
            return institute[i].adresseEthereum;
        }
    }
    return address(0); // retourne l'adresse zéro si l'email n'est associé à aucun institut
}
   function getEmailFromAddress() public view returns (string memory) {
    address ethereumAddress= msg.sender;
    for (uint i = 0; i < institute.length; i++) {
        if (institute[i].adresseEthereum == ethereumAddress) {
            return institute[i].email;
        }
    }

    // Retourner une chaîne vide si l'adresse Ethereum n'est pas trouvée
    return "";
}

//update password forget
    function resetInstitutePassword(string memory email, string memory newPassword) public {
    require(msg.sender == getInstituteAddressByEmail(email), "Seul l institut peut reinitialiser son mot de passe");

    bytes32 hashedNewPassword = sha256(abi.encodePacked(newPassword));
    compte[msg.sender].pass = hashedNewPassword;

    emit InstituteCredentialsUpdated(email, newPassword);
}

    function authorizedInstitute(string memory email, string memory password) public view returns (bool) {
    bytes32 roleInstitute = keccak256(abi.encodePacked("institute"));
    bytes32 hashedPassword = sha256(abi.encodePacked(password));
    //email hashé depuis la fonction getInstituteAddressByEmail
    address instituteAddress = getInstituteAddressByEmail(email);
    if (instituteAddress == msg.sender &&
        compte[instituteAddress].pass == hashedPassword &&
        keccak256(abi.encodePacked(compte[instituteAddress].role)) == roleInstitute
    ) {
        return true;
    }
    return false;
}
    function getPassword(address addr) public view returns(bytes32){
        return compte[addr].pass;
    }
    event InstituteCredentialsUpdated(string indexed _email, string _newPassword);

    function updateInstituteCredentials(string memory email, string memory oldPassword, string memory newPassword) public {
        require(
            authorizedInstitute(email, oldPassword),
            "ne peut pas acceder"
        );

        bytes32 hashedNewPassword = sha256(abi.encodePacked(newPassword));
        compte[msg.sender].pass = hashedNewPassword;

        emit InstituteCredentialsUpdated(email, newPassword);
    }    


    // Fonction pour ajouter un étudiant pour un institut donné
function addStudentForInstitute(address _instituteAddress, string memory _institutename,string memory _name,string memory _email, string memory _dateOfBirth, string memory _mention, string memory _dateRemiseDiplome, string memory _numCIN, string memory _department, string memory _ipfsHash,string memory _diplomaId) public {
    require(msg.sender == _instituteAddress, "Vous n etes pas autorise a ajouter un etudiant pour cet institut.");

    // Créer un nouvel étudiant
    Student memory newStudent = Student({
        institutename: _institutename,
        name: _name,
        email:_email,
        dateOfBirth: _dateOfBirth,
        mention: _mention,
        dateRemiseDiplome: _dateRemiseDiplome,
        numCIN: _numCIN,
        department:_department,
        ipfsHash:_ipfsHash,
        id:_diplomaId

    });

    // Ajouter l'étudiant à la liste correspondante à l'adresse de l'institut
    instituteToStudents[_instituteAddress].push(newStudent);
    studentsById[_diplomaId] = newStudent;
    studentByCin[_numCIN] = newStudent;
}

// Fonction pour récupérer tous les étudiants enregistrés pour un institut donné
function getStudentsForInstitute(address _instituteAddress) public view returns (Student[] memory) {
    return instituteToStudents[_instituteAddress];
}
// Fonction pour récupérer un étudiant par son diplôme ID
function getDiplomaById(string memory _diplomaId) public view returns (Student memory) {
    return studentsById[_diplomaId];
}
function getDiplomaByCin(string memory _numCIN) public view returns (Student memory){
    return studentByCin[_numCIN];
}




}
